Twitter makes it difficult to fully explain things;

This isn’t a spell slinger deck, it’s a Fliers deck first and foremost. It has Ishai and Ludevic as the commanders in order to draw cards with the various Bident-like effects, and to also have a big beater if necessary (though I usually do not play Ishai).

The question here is, is having a decently costed flier that can make another flier when I cast about 1/3rd+ of my deck worth trading in the cards from Ludevic? Cutting down on the partners also frees up another slot in the deck.
